import React from 'react';

const AboutUpdate = (props) => {

		const dataLocal = props.dataLocal.filter(data => data.category === About)

		      const display = (                                       
             <div>
                 <div className='infoCategory'>
                 {dataLocal.category}
                 </div>                                          
                 <div className='infoTitle'>                                              
                 {dataLocal.title}
                 </div>
                 <div className='aboutContent'>
                 {dataLocal.content.replace(/_n/g,"\n")}
                 </div>                                                                   
             </div>                                                                                 )                

		return (
		<div>
				{display}
		</div>
		)
}
export default AboutUpdate;
